import { UseAuthContext } from '../hooks/UseAuthContext'
import NotFound from '../components/404'

const Admin = () => {

    const {isAdmin} = UseAuthContext()

    return ( 
        <div className="container-lg">
        { 
            isAdmin 
            
            ? 
            
            <div>Welcome Admin !</div>
            
            :

            <NotFound />

        }
        </div>
     );
}
 
export default Admin;
